    [],nt"num_tags": 9,nt"name": "the-potential-effects-of-rocky-mountain-arsenal-cleanup-and-denver-metropolitan-transporta",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Army's Rocky Mountain Arsenal
    and Colorado's Barr Lake State Park provide habitats which support wintering and
    nesting bald eagles near metropolitan Denver, Colorado. Contaminant remediation
    of the Arsenal, and construction of the New Denver International Airport and the
    E-470 Highway may adversely impact bald eagles currently using these areas. In 1987,
    a cooperative 4-year study was initiated to determine the potential impacts to bald
    eagles from Arsenal cleanup and area transportation development. Bald eagle habitat
    use, home ranges, food habits and other concerns were addressed in this study.  This
    report discusses the potential impacts, importance of the Rocky Mountain Arsenal
    for bald eagle habitat, and recommendations to maintain bald eagle populations in
    Adams County, Colorado.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
